import React, { useEffect, useState } from 'react';
import {
  Button,
  Window,
  WindowContent,
  WindowHeader,
  ScrollView,
  TextInput
} from 'react95';


export default ({setShowAOL}) => {

  return (
    <>
      <Window style={{width: '360px'}} resizable className='window'>
        <WindowHeader style={{
          display: 'flex',
          justifyContent: 'space-between'
        }}>
          <span>You've got mail!</span>
          <Button style={{marginTop: '2px'}} onClick={()=>{
            setShowAOL(false)}}>
            <b>x</b>
          </Button>
        </WindowHeader>
        <WindowContent>
          From: <TextInput defaultValue='Disabled' disabled fullWidth /><br />
          Subject: <TextInput defaultValue='Disabled' disabled fullWidth />
        <ScrollView style={{
            backgroundColor: 'white',
            height: '300px',
            width: '100%',
          }}>
            <div style={{textAlign: 'center', width: 'max-content', margin: '10px', cursor: 'pointer'}}>
              Hii lil bro
            </div>
          </ScrollView>
        </WindowContent>
      </Window>

    </>
  );
}
